import React from 'react';
import { motion } from 'framer-motion';
import HeaderLinks from './HeaderLinks';
import { Link } from 'react-router-dom';
import Logo from './assets/mgilogo.png'; // Ensure the logo path is correct

function Header() {
  return (
    <motion.nav
      initial={{ y: -250 }}
      animate={{ y: 0 }}
      transition={{ type: 'spring', stiffness: 120 }}
      className="navbar navbar-expand-lg navbar-light fixed-top"
      style={{ backgroundColor: 'transparent', zIndex: 1030 }}
    >
      <div className="container-fluid d-flex justify-content-center align-items-center">
        {/* Adjusted to center the links without affecting the logo alignment */}
        <div className="d-flex justify-content-between align-items-center w-100">
          <Link to="/" className="navbar-brand" style={{ visibility: 'hidden' }}>
            <img src={Logo} alt="Logo" style={{ height: '50px' }} />
          </Link>
          <HeaderLinks />
          <Link to="/" className="navbar-brand" style={{ visibility: 'hidden' }}>
            <img src={Logo} alt="Logo" style={{ height: '50px' }} />
          </Link>
        </div>
      </div>
    </motion.nav>
  );
}

export default Header;
